import { Box } from "@mui/material";
import { useState, useEffect } from "react";
const HeroSection = () => {
  return (
    <>
      <Box sx={{ height: "100vh", width: "100%" }}>
        <FadingCardContent />
      </Box>
    </>
  );
};

const posts = [
  {
    id: 1, // could make the id increment normally with: posts.length === 0 ? 1 : posts.length[posts.length - 1].id + 1 ... i have no idea the root code, and if it might have dependencies
    img: "data:image/jpeg;base64,",
  },
  {
    id: 2, // same id logic as above
    img: "data:image/jpeg;base64,",
  },
  {
    id: 3, // same id logic as above
    img: "data:image/jpeg;base64,",
  },
  {
    id: 4, // same id logic as above
    img: "data:image/jpeg;base64,",
  },
  {
    id: 5, // same id logic as above
    img: "data:image/jpeg;base64,"
  }, 
  {
    id: 6, // same id logic as above
    img: "data:image/jpeg;base64,"
  }
];

const FadingCardContent = () => {
  const [currentElement, setCurrentElement] = useState(0);

  useEffect(() => {
    const intervalId = setInterval(() => {
      setCurrentElement((prevElement) => (prevElement + 1) % posts.length);
    }, 5000);

    return () => clearInterval(intervalId);
  }, []);

  return (
    <>
      <div style={{ position: "relative", width: "100%", height: "100%" }}>
        {posts.map((item, index) => (
          <div
            key={item.id}
            style={{
              position: "absolute",
              width: "100%",
              height: "100%",
              opacity: currentElement === index ? 1 : 0,
              transition: "opacity 5s ease-in-out",
              cursor: "pointer",
            }}
          >
            <img
              src={item.img}
              alt="image"
              style={{
                height: "100%",
                width: "100%",
                objectPosition: "center",
                objectFit: "cover",
              }}
            />
          </div>
        ))}
      </div>
    </>
  );
};

export default HeroSection;
